(7, 'Sweet Corn', 'sweet-corn', 'Maize, also known as corn, is a cereal grain first domesticated by indigenous peoples in southern Mexico about 10,000 years ago. The leafy stalk of the plant produces pollen inflorescences and separate ovuliferous inflorescences called ears that yield kernels or seeds, which are fruits.', 1, 5.00, 6, 4.00, '7', 50, 1, 0, NULL, 'publish', 'simple', '1lb', NULL, NULL, NULL, '{\"id\": \"7\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/7/Corn.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/7/conversions/Corn-thumbnail.jpg\"}', '[{\"id\": \"593\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/592/Sweet-Corn-1.png\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/592/conversions/Sweet-Corn-1-thumbnail.jpg\"}, {\"id\": \"594\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/593/Sweet-Corn-2.png\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/593/conversions/Sweet-Corn-2-thumbnail.jpg\"}, {\"id\": \"595\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/594/Sweet-Corn.png\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/594/conversions/Sweet-Corn-thumbnail.jpg\"}, {\"id\": \"744\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/743/Corn_dlrtbv.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/743/conversions/Corn_dlrtbv-thumbnail.jpg\"}]', NULL, '2021-03-08 10:48:20', '2021-06-27 03:56:42', NULL, NULL),
