(13, 'Mango', 'mango', 'A mango is a juicy stone fruit produced from numerous species of tropical trees belonging to the flowering plant genus Mangifera, cultivated mostly for their edible fruit. Most of these species are found in nature as wild mangoes. The genus belongs to the cashew family Anacardiaceae.', 1, 2.50, 6, NULL, '13', 50, 1, 0, NULL, 'publish', 'simple', '1lb', NULL, NULL, NULL, '{\"id\": \"14\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/14/Mangoes.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/14/conversions/Mangoes-thumbnail.jpg\"}', '[]', NULL, '2021-03-08 10:54:24', '2021-06-27 03:56:42', NULL, NULL),
(14, 'Pepper', 'pepper', 'Black pepper is a flowering vine in the family Piperaceae, cultivated for its fruit, known as a peppercorn, which is usually dried and used as a spice and seasoning. When fresh and fully mature, it is about 5 mm in diameter and dark red, and contains a single seed, like all drupes', 1, 6.00, 6, 5.00, '14', 50, 1, 0, NULL, 'publish', 'simple', '1lb', NULL, NULL, NULL, '{\"id\": \"15\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/15/MiniPeppers.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/15/conversions/MiniPeppers-thumbnail.jpg\"}', '[]', NULL, '2021-03-08 10:55:14', '2021-06-27 03:56:42', NULL, NULL),
