(16, 'Peeled Baby Carrot', 'peeled-baby-carrot', 'The carrot is a root vegetable, usually orange in colour, though purple, black, red, white, and yellow cultivars exist. They are a domesticated form of the wild carrot, Daucus carota, native to Europe and Southwestern Asia. The plant probably originated in Persia and was originally cultivated for its leaves and seeds.', 1, 2.50, 6, 2.20, '16', 50, 1, 0, NULL, 'publish', 'simple', '1lb', NULL, NULL, NULL, '{\"id\": \"17\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/17/Peeled-Carrots.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/17/conversions/Peeled-Carrots-thumbnail.jpg\"}', '[]', NULL, '2021-03-08 10:56:44', '2021-06-27 03:56:42', NULL, NULL),
